    function extractName(str) {
        var stepOne = str.split("[");
        var stepTwo =  stepOne[1].split("]");
        return stepTwo[0];
    }

    function getEntityIndexFromName(name, isExpected) {
        var index = -1;
        for (var j=0; j < entities.length; j++) {
            
            if (entities[j].name === name) {
                index = j;
                break;
            }

        }
        if (isExpected === true && index === -1){
            print("ERROR: entity '" + name + "' was expected to exist.");
        }
        return index;
    }


